import image from  '../images/icon-delete/delete_24px@1x.svg'


const Single = (props, {index}) => {
    return(
        <div className="component">
            <div className="paper-shadow-z-1">
                <input type="text" placeholder="Fibre" id="access-structures" />
                {
                    index ? 
                    <button type="button"  className="button ExtraButton Btn-multiple" onClick={(e) => props.removeFormFields(index,e)}><FontAwesomeIcon icon={faTrash} /></button>
                    : null
                }
            </div>
        </div>

    )
} 


export default Single;
